void ReadMLPLL2011Uni::InitTransform()
{
   InitTransform_1();
}

//_______________________________________________________________________
void ReadMLPLL2011Uni::Transform( std::vector<double>& iv, int sigOrBgd ) const
{
   Transform_1( iv, sigOrBgd );
}
